"<h2 style=\" margin-top:16px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:x-large; font-weight:700;\">Add New Trainer </span></h2>\n"
"<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Use this form to create a new trainer in your project. The trainer will automatically be added to both <span style=\" font-family:\'Courier New\';\">opponents.h</span> and <span style=\" font-family:\'Courier New\';\">trainers.party</span>. </p>\n"
