"<ul style=\"margin-top: 0px; margin-bottom: 0px; margin-left: 0px; margin-right: 0px; -qt-list-indent: 1;\">\n"
"<li style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Creates a new <span style=\" font-family:\'Courier New\';\">#define TRAINER_NAME</span> in <span style=\" font-family:\'Courier New\';\">include/constants/opponents.h</span> </li>\n"
